import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

const rows = [
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
  ['AA00', 'Dafys', "Tornillo 13mm", "200", "2500"],
];

export default function BasicTable() {
  return (
    <div style={{marginBottom: '200px'}}>
      <TableContainer style={{backgroundColor: 'white'}} component={Paper}>
        <Table aria-label="simple table" style={{ width: 'auto' }}>
          <TableHead>
            <TableRow>
              <TableCell style={{fontWeight: 'bold'}}>Codigo</TableCell>
              <TableCell>Proveedor</TableCell>
              <TableCell>Nombre</TableCell>
              <TableCell>Stock</TableCell>
              <TableCell>Precio</TableCell>
              <TableCell style={{ paddingRight: '10px' }}></TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow key={row[0]}>
                <TableCell>{row[0]}</TableCell>
                <TableCell>{row[1]}</TableCell>
                <TableCell>{row[2]}</TableCell>
                <TableCell>{row[3]}</TableCell>
                <TableCell>{row[4]}</TableCell>
                <TableCell style={{ paddingRight: '10px' }}>
                  <div style={{ display: 'flex', gap: '8px' }}>
                    <Button variant="contained" size="small">
                      VER
                    </Button>
                    <Button variant="contained" size="small">
                      EDITAR
                    </Button>
                    <Button variant="outlined" size="small" color="error">
                      BORRAR
                    </Button>
                  </div>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}
